import React from 'react';
import HeaderLinks from './HeaderLinks';
import Logo from './assets/mgilogo.png'; // Correct path to your logo

function Header() {
  return (
    <header className="App-header">
      <img src={Logo} alt="Logo" style={{ height: '50px' }} />
      <h1>My Website</h1>
      <HeaderLinks /> {/* Ensure HeaderLinks is included */}
    </header>
  );
}

export default Header;
